import { Component, OnInit } from '@angular/core';
import { ExtratoService } from '../services/extrato/extrato.service';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

//declare var pdfMake: { vfs: any; };

@Component({
	selector: 'app-extrato',
	templateUrl: './extrato.component.html',
	styleUrls: ['./extrato.component.css']
})
export class ExtratoComponent implements OnInit {

	logo_base_64 = "data:image/png;base64,";

	meses = [{ mes_id: 1, mes: "JANEIRO" }, { mes_id: 2, mes: "FEVEREIRO" }, { mes_id: 3, mes: "MARÇO" }, { mes_id: 4, mes: "ABRIL" }, { mes_id: 5, mes: "MAIO" }, { mes_id: 6, mes: "JUNHO" },
	{ mes_id: 7, mes: "JULHO" }, { mes_id: 8, mes: "AGOSTO" }, { mes_id: 9, mes: "SETEMBRO" }, { mes_id: 10, mes: "OUTUBRO" }, { mes_id: 11, mes: "NOVEMBRO" }, { mes_id: 12, mes: "DEZEMBRO" }]

	anos = new Array<any>();
	spinner = false;
	msg_sem_dados = false;

	ano_corrente = null;
	mes_selecionado = null;
	ano_selecionado = null;
	lista_gastos = null;

	nome_filiado: any = null;
	matricula: any = null;
	cpf: any = null;
	gastos_mes = new Array<any>();
	data_impressao: any = null;

	constructor(private extratoService: ExtratoService) {
		let data = new Date();
		this.ano_corrente = data.getFullYear();
	}

	ngOnInit(): void {
		this.montaAnos();
	}

	mostraMesSelecionado() {
		console.log("Mes: " + this.mes_selecionado);
		console.log("Ano: " + this.ano_selecionado);
	}

	montaAnos() {

		for (let i = 2018; i <= this.ano_corrente; i++) {

			let ano = {
				ano_id: i,
				ano: i
			}

			this.anos.push(ano);

		}
	}

	montaData() {
		let data_hoje = new Date();
		let dia = data_hoje.getDate();
		let mes = data_hoje.getMonth() + 1;
		let ano = data_hoje.getFullYear();
		this.data_impressao = dia + '/' + mes + '/' + ano;
		console.log(this.data_impressao);
	}

	buscaValores() {
		this.msg_sem_dados = false;
		this.lista_gastos = null;
		this.spinner = true;
		this.extratoService.buscarValores(this.mes_selecionado, this.ano_selecionado)
			.subscribe((data: any) => {


				this.spinner = false;
				if (data.gastos.length > 0) {
					this.lista_gastos = data;

					this.nome_filiado = this.lista_gastos.gastos[0].name;
					this.matricula = this.lista_gastos.gastos[0].matricula;
					this.cpf = this.lista_gastos.cpf;

					console.log(this.lista_gastos.gastos);
					console.log(this.lista_gastos);

					console.log(this.cpf);


					this.gastos_mes = new Array<any>();
					// var cabecalho = [];

					// cabecalho.push('CONVÊNIO');
					// cabecalho.push('R$ VALOR');
					// this.gastos_mes.push(cabecalho);

					for (let i = 0; i < this.lista_gastos.gastos.length; i++) {

						var dados = [];

						dados.push(this.lista_gastos.gastos[i].convenio);
						dados.push({ text: this.lista_gastos.gastos[i].valor.toString(), alignment: 'right' });


						this.gastos_mes.push(dados);
					}

					this.montaData();
					console.log(this.gastos_mes);

				} else {
					this.msg_sem_dados = true;
				}

			}, (erro) => {
				this.spinner = false;
				console.log(erro);
			});
	}

	imprimirExtrato() {

		var matricula = this.matricula;
		var cpf =  this.cpf;
		var nome = this.nome_filiado;
		var data = this.data_impressao;

		var documentDefinition = {

			info: {
				title: 'Extrato de descontos',
				author: 'Portal do Filiado',
			},
			// a string or { width: number, height: number }
			pageSize: 'A4',

			// by default we use portrait, you can change it to landscape if you wish
			pageOrientation: 'portrait',

			footer: function (currentPage, pageCount) {
				return {
					table: {
						widths: [100, 350, "*"],
						body: [
							[
								{ text: 'Pagina ' + currentPage.toString() + ' de ' + pageCount, alignment: 'right', fontSize: 9  },
								{ text: '' },
								{ text: 'Impresso em: ' + data, alignment: 'left', fontSize: 9  }
							]

						],
					},
					layout: 'noBorders'
				};
			},


			watermark: { text: 'COMPANY', color: 'green', opacity: 0.1, bold: false, italics: false },

			content: [

				{
					style: 'tableExample',
					table: {
						widths: [50, '*'],
						body: [
							[{ rowSpan: 4, image: this.logo_base_64, width: 50 }, { text: '' }],
							['', { text: '' }],
							['', { text: '' }],
							['', { text: 'Sindicato dos Trabalhadores em Instituições Federais de Educação Profissional e Tecnológica - GOIÁS', alignment: 'center', bold: true }],
						]
					}, layout: {

						hLineColor: function (i, node) {
							return (i === 0 || i === node.table.body.length) ? 'black' : 'white';
						},
						vLineColor: function (i, node) {
							return (i === 0 || i === node.table.widths.length) ? 'black' : 'white';
						},
					}

				},


				{
					style: 'tableDadosCabecalho',
					table: {
						widths: [50, '*'],
						body: [
							[{ text: 'Nome........:' }, { text: nome }],
							[{ text: 'Matricula..:' }, { text: matricula }],
							['CPF...........:', cpf],
							['Referência:',this.lista_gastos.mes +"/"+ this.lista_gastos.ano]
						]
					}, layout: {

						hLineColor: function (i, node) {
							return (i === 0 || i === node.table.body.length) ? 'black' : 'white';
						},
						vLineColor: function (i, node) {
							return (i === 0 || i === node.table.widths.length) ? 'black' : 'white';
						},
					}
				},


				{ text: '\n\n' },
				{ style: 'header', text: 'Extrato de descontos' },
				{ text: '\n\n' },

				{
					//style: 'tableExample',
					table: {
						headerRows: 1,
						widths: [200, 80],
						body: [
							[{ text: 'Convenio', style: 'tableHeaderDados', alignment: 'center' }, { text: 'Valor', style: 'tableHeaderDados', alignment: 'center' }]

						]
					}
				},

				{
					style: 'tableDados',
					table: {
						//	headerRows:[1,  alignment: 'center'],
						widths: [200, 80],
						body: this.gastos_mes
					}
				},

				{
					table: {
						headerRows: 1,
						widths: [200, 80],
						body: [
							[{ text: 'Total de descontos: ', style: 'tableHeaderDados', alignment: 'right' }, { text: this.lista_gastos.total, style: 'tableHeaderDados', alignment: 'right' }]

						]
					}
				},




			],
			styles: {
				header: {
					fontSize: 18,
					bold: true,
					alignment: 'center',
					margin: [0, 0, 0, 10]
				},
				subheader: {
					fontSize: 16,
					bold: true,
					margin: [0, 10, 0, 5]
				},
				tableExample: {
					margin: [0, 5, 0, 5]

				},
				tableDados: {
					fontSize: 9,
					margin: [0, 5, 0, 5]
				},
				tableDadosCabecalho: {
					fontSize: 9,
					bold: true,
					margin: [0, 5, 0, 5]
				},
				tableHeaderDados: {
					bold: true,
					fontSize: 10,
					color: 'black'
				},
				tableHeader: {
					bold: true,
					fontSize: 13,
					color: 'black'
				}
			}

		}


		pdfMake.createPdf(documentDefinition).open();
	}



}
